import React from 'react';
import { Table, TableBody, TableCell, TableHead, TableRow, Paper } from '@mui/material';

const rows = [
    { id: 1, name: 'Arch Capital Group', price: '$100.57', aiScore: 82 },
    { id: 2, name: 'Axonics', price: '$67.08', aiScore: 80 },
    { id: 3, name: 'Blackstone', price: '$117.62', aiScore: 79 }
];

function StockTable() {
    return (
        <Paper sx={{ width: '100%', overflowX: 'auto' }}>
            <Table aria-label="simple table">
                <TableHead>
                    <TableRow>
                        <TableCell>Company</TableCell>
                        <TableCell align="right">Price</TableCell>
                        <TableCell align="right">AI Score</TableCell>
                        <TableCell align="right">AI Analysis</TableCell>
                        <TableCell align="right">Add to Portfolio</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {rows.map((row) => (
                        <TableRow key={row.id}>
                            <TableCell component="th" scope="row">
                                {row.name}
                            </TableCell>
                            <TableCell align="right">{row.price}</TableCell>
                            <TableCell align="right">{row.aiScore}</TableCell>
                            <TableCell align="right"><button>Analyze</button></TableCell>
                            <TableCell align="right"><button>Add</button></TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </Paper>
    );
}

export default StockTable;
